  static defaultProps = {
    colorOption: [
      'blue',
      'brown',
      'teal',
      'aliceblue',
      'aqua',
      'darkcyan',
      'darkslategray',
      'slategray',
      'lightslategrey'
    ]
  };
  constructor() {
    super();
  }

  render() {
    console.log(this.defaultProps.colorOption);
    return (
      <div>
        <h1>Random Color Component</h1>
      </div>
    );
  }
}

export default RandomColor;
